import React from 'react';
import styled from 'styled-components';

const Module = styled.div`
  position:fixed;
  width: 100%;
  height: 100%;
  z-index: 10;
  background-color:#fff;
  display: ${props => props.active ? "block" : "none"}
`

function AddHabitModule(props){
  return (
    <Module active>

    </Module>
  )
}


export default AddHabitModule;
